const DATE = new Date().getFullYear();

const Footer = () => {
  return (
    <>
      <footer className="bg-gray-200 h-54 sm:mt-12 sm:p-12 flex justify-between">
        <div>
          <p>Designed and developed by Angel Archbold 💚</p>
        </div>
        <div>
          <p> © {DATE} - Bambo 🐼</p>
        </div>
      </footer>
    </>
  );
};

export default Footer;
